    return(
        <>
         <div style={{backgroundColor:"white" , boxShadow:"0px 10px 10px gray" , color:"black" , margin:"10px"}}>
            <h1>{{personName}}</h1>
            <h2>{{email}}</h2>
           
            <hr></hr>
            <p>{content}</p>
         </div>
        </>
    )
}
